import { useRouter } from "next/router";
import React, { FC } from "react";
import { useQuery } from "@apollo/client";
import { usersQuery } from "../../graphql/user/query";
import SearchUserPresenter from "./SearchUserPresenter";

const SearchUserContainer: FC = () => {
  const router = useRouter();

  const { data } = useQuery(usersQuery, {
    variables: {
      keyword: decodeURIComponent(router.query.keyword as string),
      first: 10
    }
  });

  return <SearchUserPresenter users={data.getUsers} />;
};

export default SearchUserContainer;
